ing typical of Puruchuco khipu.  The final cord has three components: KB, W, and W-AB.  These three are plied together.  Before final plying, primary cord has two components: one of KB interlocked with W at the doubling point, one of AB interlocked with W at the doubling point.  The presumption is that the W and AB cord was doubled and plied Z, then the KB W cord was doubled and all three were plied together S.  For sketch, see original notes.  Color shorthand KB-W-(W-AB).  ',0,52.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','Primary cord has complex color patterning typical of Puruchuco khipu.  The final cord has three components: KB, W, and W-AB.  These three are plied together.  Before final plying, primary cord has two components: one of KB interlocked with W at the doubling point, one of AB interlocked with W at the doubling point.  The presumption is that the W and AB cord was doubled and plied Z, then the KB W cord was doubled and all three were plied together S.  For sketch, see original notes.  Color shorthand KB-W-(W-AB).  '),(1000244,1000239,'P',2.5000,'Primary cord probably had another color previously',0,47.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','Primary cord probably had another color previously'),(1000245,1000240,'P',2.7000,'',0,35.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','U',''),(1000246,1000241,'P',2.0000,'Dark brown plies have disintegrated.  Color is more accurately notated as (AB-CB) - AB.  All of these elements are the same size; there are about 6 elements in each bundle.  ',NULL,NULL,NULL,NULL,NULL,NULL,'2011-11-24 03:42:40',NULL,'2011-09-29 04:52:18',NULL,NULL),(1000247,1000242,'P',0.0000,'The brown color is disintegrating in places.',0,29.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','The brown color is disintegrating in places.'),(1000248,1000243,'P',2.1000,'Final cord has three components: one solid, two barber pole: MB- (CB-W)-(CB-W).  ',NULL,NULL,NULL,NULL,NULL,NULL,'2011-11-24 03:42:40',NULL,'2011-09-29 04:52:18',NULL,NULL),(1000249,1000244,'P',3.0000,'Each component of the primary cord has 9 2-ply components.  ',NULL,NULL,NULL,NULL,NULL,NULL,'2011-11-24 03:42:40',NULL,'2011-09-29 04:52:18',NULL,NULL),(1000250,1000245,'P',0.0000,'Very little of primary cord visible. ',NULL,NULL,NULL,NULL,NULL,NULL,'2011-11-24 03:42:40',NULL,'2011-09-29 04:52:18',NULL,NULL),(1000251,1000246,'P',3.5000,'',0,51.000,'CN','R','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S',''),(1000252,1000247,'P',2.0000,'Typical Puruchuco primary cord structure: two plain components, one barberpole component.  W - KB - (W-KB)',0,53.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','Z','Typical Puruchuco primary cord structure: two plain components, one barberpole component.  W - KB - (W-KB)'),(1000253,1000248,'P',2.0000,'',0,41.500,'CN','K','D','cbrezine','2011-11-24 03:42:40','cbrezine','2004-08-19 19:57:15','S',''),(1000254,1000249,'P',3.3000,'Characteristic Puruchuco primary cord structure: (AB-KB) - AB-KB',0,37.500,'CN','R','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','Characteristic Puruchuco primary cord structure: (AB-KB) - AB-KB'),(1000255,1000250,'P',1.7000,'spiralled with knotted end inside',0,36.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','spiralled with knotted end inside'),(1000256,1000251,'P',2.8000,'Urton thinks primary cord is olive green; Brezine sees more blue, such as GL.  Characteristic Puruchuco primary cord arrangement: (TG-MB) - TG - MB.  Blue portions of cord have 12-13 2-ply  components; brown has 26 2 ply components, counted at ravelled end. ',0,50.000,'CN','R','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','Z','Urton thinks primary cord is olive green; Brezine sees more blue, such as GL.  Characteristic Puruchuco primary cord arrangement: (TG-MB) - TG - MB.  Blue portions of cord have 12-13 2-ply  components; brown has 26 2 ply components, counted at ravelled end. '),(1000257,1000252,'P',2.2000,'This cord would usually be denoted RL:W, mottled.  It is composed of four strands of RL and W barberpoled. (RL-W) x 4',0,66.500,'CN','K','D','cbrezine','2011-11-24 03:42:40','cbrezine','2004-08-20 14:00:44','U','This cord would usually be denoted RL:W, mottled.  It is composed of four strands of RL and W barberpoled. (RL-W) x 4'),(1000258,1000253,'P',1.6000,'Characteristic Puruchuco patterning: (W-KB) - W - KB',0,84.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','Z','Characteristic Puruchuco patterning: (W-KB) - W - KB'),(1000259,1000254,'P',2.7000,'Characteristic Puruchuco cord patterning: (AB-W) - W - MB.  (Browns may be the same color, hard to tell).  All four components are the same size.  ',0,57.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','cbrezine','2004-09-01 15:14:40','S','Characteristic Puruchuco cord patterning: (AB-W) - W - MB.  (Browns may be the same color, hard to tell).  All four components are the same size.  '),(1000260,1000255,'P',3.4000,'Primary cord tapers towards knot. ',0,67.000,'CN','K','D','cbrezine','2011-11-24 03:42:40','cbrezine','2004-08-20 20:21:31','S','Primary cord tapers towards knot. '),(1000261,1000256,'P',0.0000,'(AB-AB) - (GG-W)',0,73.500,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','(AB-AB) - (GG-W)'),(1000262,1000257,'P',0.0000,'The tassel is of red camelid  2-ply S yarns; the cord itself is of cotton.  The join between the tassel and the cord is wrapped with brown cotton thread for about 3 cm.  Wrapping forms a cone shape.  Measurements begin at the far edge of the wrapping.  The tassel is about 2.5 cm long; tassel length is variable and is not included in cord measurement.  A dark brown element has been lost from the primary cord.  All primary cord components are the same size.  (AB-AB-AB-KB)-(AB-AB)',0,75.000,'CC','K','TL','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','The tassel is of red camelid  2-ply S yarns; the cord itself is of cotton.  The join between the tassel and the cord is wrapped with brown cotton thread for about 3 cm.  Wrapping forms a cone shape.  Measurements begin at the far edge of the wrapping.  The tassel is about 2.5 cm long; tassel length is variable and is not included in cord measurement.  A dark brown element has been lost from the primary cord.  All primary cord components are the same size.  (AB-AB-AB-KB)-(AB-AB)'),(1000263,1000258,'P',2.7000,'CB-AB-(AB-CB)',0,62.500,'CN','K','D','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','Z','CB-AB-(AB-CB)'),(1000264,1000259,'P',2.8000,'Primary cord has two components, each of which has 4 (?) elements.  Each of the final two includes AB, MB, HB.  Ascher description would be AB:MB:HB for these components; more accurately described as (AB-MB)-(AB-HB).   There is an \"anomolous knot or bulge\" in primary cord in 1 cm space between groups at 34 cm and 37 cm (between cords 104 and 105).',0,115.000,'CN','K','T','cbrezine','2011-11-24 03:42:40','cbrezine','2004-08-24 13:37:38','S','Primary cord has two components, each of which has 4 (?) elements.  Each of the final two includes AB, MB, HB.  Ascher description would be AB:MB:HB for these components; more accurately described as (AB-MB)-(AB-HB).   There is an \"anomolous knot or bulge\" in primary cord in 1 cm space between groups at 34 cm and 37 cm (between cords 104 and 105).'),(1000265,1000260,'P',6.0000,'Cord is 3-ply final S.  Each ply is RL-AB-GG.  Final effect RL:AB:GG.  ',0,79.000,'CN','R','K','cbrezine','2011-11-24 03:42:40','','0000-00-00 00:00:00','S','Cord is 3-ply final S.  Each ply is RL-AB-GG.  Final effect RL:AB:GG.  '),(1000266,1000261,'P',0.0000,'Three ply cord, final S.  End of cord is wrapped for 1.5 cm with thread color RL.  The plies are colored (MB:W) - (MB:W) - MB. ',NULL,NULL,NULL,NULL,NULL,NULL,'2011-11-24 03:42:40',NULL,'20